if mibBuilder.loadTexts: smMlmThresholdReArmCondition.setDescription("Condition operation for the rearm threshold value. [type keyword] [statistics keyword] condition Allowed conditions are: =, >, >=, >+, <, <=, <-, !=, !, ~, ~=, !~, !~=, &, |, changes, doesNotChange, exists, and doesNotExist. Checking against the rearm condition is started when a threshold is reached and is stopped when the rearm condition is met. Once the rearm condition is met, the threshold condition operation is restarted. The ~(LIKE) condition is for extended regular expression checking on strings. The style of the regular expression is of the format for the ed or egrep command. The ~(LIKE) is case insensitive, while the ~=(LIKE CASE) is case sensitive. The >+ and <- condition checks for a value increase(>+) above or a value decrease(<-) below the threshold value on consecutive polls. Once the condition is met the arm condition is also checked on consecutive polls. NOTE: Thresholds for Counter variables are computed by calculating the change per second in the sampled values and comparing these against the threshold value. In the case of Gauge and INTEGER variables, the actual value of the variable is checked against the threshold value. The statistics keywords 'iMax', 'iMin', 'iAvg', 'iSd', 'iVar', 'iRate', 'Max', 'Min', 'Avg', 'Sd', and 'Var' if placed in front of the condition (and separated from if by a space) allows the use of the interval or lifetime maximum, minimum, average, standard deviation, variance, and rate. These values are calculated for each MIB variable returned in the threshold. For the interval keywords the sampling interval is defined by the MIB variable: smMlmProgramControlSamplesPerInterval. For example, if the smMlmProgramControlSamplesPerInterval is 10 then the 'iAvg' keyword is the average value of the last ten samples returned to the threshold for each MIB value. The type keywords 'delta' and 'value', if placed in front of the condition or statistics keywords (and separated from it by a space) will override this default behavior. For example, a condition of 'value >' will cause threshold checking to be performed against the actual value rather than the change in the value even if the selected MIB variable is a Counter; a condition of 'delta >' causes the change in the variable (from the previous value) to be checked against the threshold, regardless of the type of the variable.")
smMlmThresholdReArmValue = MibTableColumn((1, 3, 6, 1, 4, 1, 2, 6, 12, 5, 1, 1, 22), DisplayString()).setMaxAccess("readwrite")
if mibBuilder.loadTexts: smMlmThresholdReArmValue.setStatus('mandatory')
if mibBuilder.loadTexts: smMlmThresholdReArmValue.setDescription("This field specifies the value against which retrieved variables are checked. The type of check which is done depends on the type of the retrieved variable. If the variable is numeric (INTEGER, Counter, etc.) this field is presumed to be a number, and a numeric comparison is performed using the specified threshold condition. If the retrieved variable is a DisplayString (OCTET STRING) and the 'value' keyword is used on the condition then both the retrieved variable and this field can be converted to a floating point number, a floating-point comparison is done; otherwise a string comparison is done. If the ~(LIKE) or ~=(LIKE CASE) condition is used then the value can be an extended regular expression. A value expression is also allowed to be specified. The expression can be any expression comprised of the following functions: 'Min' - lifetime minimum 'iMin' - interval minimum 'Max' - lifetime maximum 'iMax' - interval maximum 'Avg' - lifetime average 'iAvg' - interval average 'Sd' - lifetime standard 'iSd' - interval standard deviation deviation 'Var' - lifetime variance 'iVar' - interval variance 'Smpls' - lifetime samples 'iSmpls' - interval samples 'sTime' - sample time in secs 'iTime' - interval time in secs 'iRate' - rate of change over the interval The interval is defined by the MIB variable: smMlmProgramControlSamplesPerInterval. The expression has the following high to low precedence and left to right associativity of operators: () : grouping - : unary minus * : multiplication, / : division, % : remainder + : addition, - : subtraction << : bitwise left shift, >> : bitwise right shift & : bitwise AND ^ : bitwise exclusive OR | : bitwise inclusive OR Expression evaluation/operators are based on standard c program execution. For example: Avg+2*Sd is the average value over the lifetime of the threshold plus two times the standard deviation.")
