smMlmFilterEntryEnterpriseExpression = MibTableColumn((1, 3, 6, 1, 4, 1, 2, 6, 12, 7, 4, 1, 6), DisplayString()).setMaxAccess("readwrite")
if mibBuilder.loadTexts: smMlmFilterEntryEnterpriseExpression.setStatus('mandatory')
if mibBuilder.loadTexts: smMlmFilterEntryEnterpriseExpression.setDescription('This field is used to match the rule against the enterpriseID contained in the received trap. This is the default enterpriseID expression. If in the specific trap expression, this particular specific trap number does not have any enterpriseID associated with it for matching then the trap is matched with this rule. The entry may be an alias name (from the smMlmAlias table), an enterpriseID in dot notation, or an enterpriseID with a wildcard value (terminated by an asterisk). The enterpriseID in dot notation should be fully qualified. An enterpriseID with a wildcard value matches any enterpriseID with the same partial enterpriseID.')
smMlmFilterAgentAddrExpression = MibTableColumn((1, 3, 6, 1, 4, 1, 2, 6, 12, 7, 4, 1, 7), DisplayString()).setMaxAccess("readwrite")
if mibBuilder.loadTexts: smMlmFilterAgentAddrExpression.setStatus('mandatory')
if mibBuilder.loadTexts: smMlmFilterAgentAddrExpression.setDescription("This field is used to match against the address of the agent that generated the trap. For the Mid-Level Manager, the agent address expression is a comma separated list of: 1) an smMlmAliasName (from the smMlmAlias table) 2) a resolvable hostname 3) an ipAddress expression. If the agent address expression contains an smMlmAliasName or hostname, the addresses to check the trap against are determined each time a trap is received. An ipAddress expression contains four dot separated sub-expressions that can be either: 1) a decimal number between 0 and 255 2) an inclusive range of numbers between 0 and 255 specified by [#-#] (ie. [0-127]) 3) an asterisk (which is simply interpreted as [0-255]). An example ipAddress expression is '9.67.[128-130].*'.")
smMlmFilterGenericExpression = MibTableColumn((1, 3, 6, 1, 4, 1, 2, 6, 12, 7, 4, 1, 8), DisplayString()).setMaxAccess("readwrite")
if mibBuilder.loadTexts: smMlmFilterGenericExpression.setStatus('mandatory')
if mibBuilder.loadTexts: smMlmFilterGenericExpression.setDescription('This field is used to match against the generic trap number contained in the received trap. This field allows a comma separated list of generic trap numbers. If specific trap numbers are to be checked, a 6 (ie. enterprise-specific trap) must be encoded in the generic expression. The generic traps are: 0 - Cold Start 1 - Warm Start 2 - Link Down 3 - Link Up 4 - Authentication Failure 5 - EGP Neighbor Loss 6 - Enterprise Specific')
smMlmFilterSpecificExpression = MibTableColumn((1, 3, 6, 1, 4, 1, 2, 6, 12, 7, 4, 1, 9), DisplayString()).setMaxAccess("readwrite")
if mibBuilder.loadTexts: smMlmFilterSpecificExpression.setStatus('mandatory')
if mibBuilder.loadTexts: smMlmFilterSpecificExpression.setDescription("This field is used to match against the specific trap number contained in the received trap along with the enterpriseID. This allows specific traps numbers to be grouped with enterpriseID. This field allows a comma separated list of specific groups or specific trap numbers or range of specific traps. A range of specific trap numbers may be specified by using the range format of '[#-#]' (ie. [100-199]). A group of specific trap numbers or range with EnterpriseID can be specified using the grouping format 'EnterpriseID(x,y,[a-b])' example: .1.3.6.1.4.1.2.6.12( 15, 20, [100-199]) This field will only be checked if a 6 (ie. enterprise-specific trap) is contained in the generic trap expression.")
smMlmFilterVariableExpression = MibTableColumn((1, 3, 6, 1, 4, 1, 2, 6, 12, 7, 4, 1, 10), DisplayString()).setMaxAccess("readwrite")
if mibBuilder.loadTexts: smMlmFilterVariableExpression.setStatus('mandatory')
if mibBuilder.loadTexts: smMlmFilterVariableExpression.setDescription("This field is used to match trap against the environment variables, set on the basis of MIB variables and other information flowing in the trap. The expression can be any expression with left operand as environment variable name( prepended with $) and right operand as values of variables or regular expression, with the following operators: () : grouping && : logical and || : logical or == : equal to != : not equal to < : less than <= : less than equal to > : greater than >= : greater than equal to ! : negation The precedence and associativity of operators is same as in c language and expression evaluation is based on standard c program execution. Set of environment variables that can be used in the expression are: SM6K_HOSTNAME={hostname running subagent} SM6K_DOMAIN_NAME={fully qualified hostname} SM6K_HOST_ADDRESS={ip address} SM6K_INSTANCE_NAME={instance string of row} SM6K_INSTANCE_ID={instance ASCII octet value of row} SM6K_EXECUTION_REASON=Filter_Matched|Filter_Armed| Filter_Disarmed SM6K_TRAP_ENTERPRISE={enterprise ID from the trap} SM6K_TRAP_AGENT_ADDRESS={IP address of the sending agent} SM6K_TRAP_GENERIC_NUM={generic trap number of the trap} SM6K_TRAP_SPECIFIC_NUM={specific trap number of the trap} SM6K_TRAP_TIME_TICKS={time ticks since the sending agent was started} SM6K_NUM_TRAP_VARS={number of MIB variables in the trap} SM6K_TRAP_VAR_OBJ_ID#={Object ID for MIB variable in trap} SM6K_TRAP_VAR_TYPE#=INTEGER|Counter|Gauge|TimeTicks| IpAddress|OCTET_STRING|Opaque| OBJECT_IDENTIFIER|NULL|Unknown SM6K_TRAP_VAR_VALUE#={value of the MIB object} where the # is replaced by the trap variable's positional number in the trap (starting at 1). Values can be in the form of integer, dot notation or string or hex string. If it is a string it should be within quotes. Format of regular expression is: RE:expression (within double quotes), where 'expression' is the extended regular expression in the style of ed or egrep command. example: Check for trap number 22 from System Information Agent. ( $SM6K_TRAP_ENTERPRISE == .1.3.6.1.4.1.2.6.12) && ( $SM6K_TRAP_SPECIFIC_NUM == 22 ) If the expression evaluates to TRUE, then the trap is matched.")
