if mibBuilder.loadTexts: smMlmFilterActivationTime.setDescription('This field specifies the time to activate the filter (ie. change the participation state from inactive to active). The format should be HH:MM where HH represents the hour (integer between 0 and 23) and MM represents the minute (integer between 0 and 59) to activate the filter. A value all blanks will be interpreted as 00:00.')
smMlmFilterActivationDayOfWeek = MibTableColumn((1, 3, 6, 1, 4, 1, 2, 6, 12, 7, 4, 1, 13), DisplayString()).setMaxAccess("readwrite")
if mibBuilder.loadTexts: smMlmFilterActivationDayOfWeek.setStatus('mandatory')
if mibBuilder.loadTexts: smMlmFilterActivationDayOfWeek.setDescription("This field specifies the days of the week to activate the filter at the time specified in the ActivationTime field (ie. change the participation state from inactive to active). The day of the week may be one of three literals: none - Doesn't Activate weekdays - Activates filter entry on MTWThF all - Activates filter entry every day SuMTWThFS Alternatively, the days of the week may be specified as a list of numbers between 0 and 6 (Sunday = 0, Monday = 1, ..., Saturday = 6). The expression '1,3,5' would activate the filter entry at the specified time on MWF.")
smMlmFilterDeactivationTime = MibTableColumn((1, 3, 6, 1, 4, 1, 2, 6, 12, 7, 4, 1, 14), DisplayString()).setMaxAccess("readwrite")
if mibBuilder.loadTexts: smMlmFilterDeactivationTime.setStatus('mandatory')
if mibBuilder.loadTexts: smMlmFilterDeactivationTime.setDescription('This field specifies the time to deactivate the filter (ie. change the participation state from active to inactive). The format should be HH:MM where HH represents the hour (integer between 0 and 23) and MM represents the minute (integer between 0 and 59) to deactivate the filter. A value all blanks will be interpreted as 00:00.')
smMlmFilterDeactivationDayOfWeek = MibTableColumn((1, 3, 6, 1, 4, 1, 2, 6, 12, 7, 4, 1, 15), DisplayString()).setMaxAccess("readwrite")
if mibBuilder.loadTexts: smMlmFilterDeactivationDayOfWeek.setStatus('mandatory')
if mibBuilder.loadTexts: smMlmFilterDeactivationDayOfWeek.setDescription("This field specifies the days of the week to deactivate the filter at the time specified in the DeactivationTime field (ie. change the participation state from active to inactive). The day of the week may be one of three literals: none - Doesn't deactivate weekdays - Dectivates filter entry on MTWThF all - Deactivates filter entry every day SuMTWThFS Alternatively, the days of the week may be specified as a list of numbers between 0 and 6 (Sunday = 0, Monday = 1, ..., Saturday = 6). The expression '1,3,5' would deactivate the filter entry at the specified time on MWF.")
