if mibBuilder.loadTexts: smMlmFilterMatchedCommand.setDescription("This field specifies the command to be executed when a received trap matches the filter. A set of environment variables are defined that contain information from the received trap. They may be used by the command that is executed. The following environment variables pertain to the Mid-Level Manager filter: SM6K_HOSTNAME={hostname running subagent} SM6K_DOMAIN_NAME={fully qualified hostname} SM6K_HOST_ADDRESS={ip address} SM6K_INSTANCE_NAME={instance string of row} SM6K_INSTANCE_ID={instance ASCII octet value of row} SM6K_EXECUTION_REASON=Filter_Matched|Filter_Armed| Filter_Disarmed The following environment variables pertain to the received trap: SM6K_TRAP_ENTERPRISE={enterprise ID from the trap} SM6K_TRAP_AGENT_ADDRESS={IP address of the sending agent} SM6K_TRAP_GENERIC_NUM={generic trap number of the trap} SM6K_TRAP_SPECIFIC_NUM={specific trap number of the trap} SM6K_TRAP_TIME_TICKS={time ticks since the sending agent was started} SM6K_NUM_TRAP_VARS={number of MIB variables in the trap} In addition, for each variable flowing in the trap: SM6K_TRAP_VAR_OBJ_ID#={Object ID for MIB variable in trap} SM6K_TRAP_VAR_TYPE#=INTEGER|Counter|Gauge|TimeTicks| IpAddress|OCTET_STRING|Opaque| OBJECT_IDENTIFIER|NULL|Unknown SM6K_TRAP_VAR_VALUE#={value of the MIB object} where the # is replaced by the trap variable's positional number in the trap (starting at 1) For more information see the accompanying documentation.")
