if mibBuilder.loadTexts: smMlmFilterThrottleDisarmTimer.setDescription('This field specifies the time period to elapse before the throttle is disarmed (reset). It is important to note that if smMlmThrottleDisarmTrapCount is set to a value greater than 0, the amount of time specified may not elapse before the throttle is disarmed. This time period is from the time the throttle is started (ie. from the time the first matching trap is received), not from the time the throttle is armed. Therefore, it is possible that the throttle will not be armed before the throttle is disarmed (reset). In this case, the disarm command is NOT executed.')
