if mibBuilder.loadTexts: smMlmFilterThrottleDisarmedCommand.setDescription("This field specifies the command to execute when the throttle is DISARMED. The throttle is disarmed when either 1) the smMlmThrottleDisarmTrapCount matching traps have occurred after the throttle was armed, or 2) the smMlmFilterThrottleDisarmTimer has expired. NOTE: If the above mentioned timer expires and the throttle is NOT currently ARMED, the throttle is reset, but this disarm command is NOT executed. So, the disarm command is only executed if the throttle is armed before being disarmed. A set of environment variables are defined that contain information from the received trap. They may be used by the command that is executed. The following environment variables pertain to the Mid-Level Manager filter: SM6K_HOSTNAME={hostname running subagent} SM6K_DOMAIN_NAME={fully qualified hostname} SM6K_HOST_ADDRESS={ip address} SM6K_INSTANCE_NAME={instance string of row} SM6K_INSTANCE_ID={instance ASCII octet value of row} SM6K_EXECUTION_REASON=Filter_Disarmed SM6K_THROTTLE_ARM_COUNT={value of ThrottleArmTrapCount} SM6K_THROTTLE_DISARM_COUNT={value of ThrottleDisarmTrapCount} SM6K_THROTTLE_DISARM_TIMER={value of ThrottleDisarmTimer} The following environment variables pertain to the received trap: SM6K_TRAP_ENTERPRISE={enterprise ID from the trap} SM6K_TRAP_AGENT_ADDRESS={IP address of the sending agent} SM6K_TRAP_GENERIC_NUM={generic trap number of the trap} SM6K_TRAP_SPECIFIC_NUM={specific trap number of the trap} SM6K_TRAP_TIME_TICKS={time ticks since the sending agent was started} SM6K_NUM_TRAP_VARS={number of MIB variables in the trap} In addition, for each variable flowing in the trap: SM6K_TRAP_VAR_OBJ_ID#={Object ID for MIB variable in trap} SM6K_TRAP_VAR_TYPE#=INTEGER|Counter|Gauge|TimeTicks| IpAddress|OCTET_STRING|Opaque| OBJECT_IDENTIFIER|NULL|Unknown SM6K_TRAP_VAR_VALUE#={value of the MIB object} where the # is replaced by the trap variable's positional number in the trap (starting at 1).")
