if mibBuilder.loadTexts: smMlmFilterTcpTrapReception.setDescription('Indicator of whether or not the Mid-Level Manager should connect to the tcp trap socket. If enabled(1), the traps will be read from the socket. If disabled(2), only traps generated by the Mid-Level Manager (e.g. thresholding, status, discovery traps) and traps received from the UDP socket will be filtered by the Mid-Level Manager. Note: This field cannot be set to enabled if another process on the host is already listening to the configured TCP port (i.e. the manager). Conversely, another process on the host (ie. the manager) will not be able to receive traps if this field is set to enabled. Therefore, if a manager is running on the same host as the Mid-Level Manager, this field should be set to disabled. If this field is set to enabled and any other process is connected to the port specified by the TcpTrapReceptionPort then TcpTrapReceptionStatus variable is set to portBusy. To recheck the availability of the port, this field should be disabled and then reset to enabled.')
